import { Redirect, Route } from "react-router-dom";
import { useHistory } from "react-router-dom";

export default function Logout(){
    alert("logout");

    const history = useHistory();
    localStorage.setItem("isAuthenticated","false");
   history.push("/login");
   alert("logout");
}
